package com.sat.donatarias.controller;


import java.util.List;
import javax.websocket.server.PathParam;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.CrossOrigin;
import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.PostMapping;
import org.springframework.web.bind.annotation.RequestBody;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestParam;
import org.springframework.web.bind.annotation.RestController;
import com.sat.donatarias.bean.AutorizacionSolicitud;
import com.sat.donatarias.bean.ContribuyenteAmpliado;
import com.sat.donatarias.bean.RespuestaSolicitud;
import com.sat.donatarias.bean.SolicitudDonativos;
import com.sat.donatarias.bean.StringResponse;
import com.sat.donatarias.model.DTOActividades;
import com.sat.donatarias.model.DTOCodigoPostal;
import com.sat.donatarias.model.DTOEstados;
import com.sat.donatarias.model.DTOMunicipio;
import com.sat.donatarias.model.DTOTipoSolicitud;
import com.sat.donatarias.service.DonativosDeduciblesService;


@CrossOrigin
@RestController
@RequestMapping("/SolicitudesDonativoDeducibles")
public class SolDonativosDeduciblesController {
	
	@Autowired
	DonativosDeduciblesService serviceDonativosDeducibles;  
	
	@GetMapping("/validaUsuarioRfcAmpliado/{rfc}")
	public ContribuyenteAmpliado validaUsuarioRfcAmpliado(@PathParam("rfc") String rfc) {
		return serviceDonativosDeducibles.validaUsuarioRfcAmpliado(rfc); 
	}
	
	
	@PostMapping("/guardaSolicitudDonativos")
	public RespuestaSolicitud guardaSolicitudDonativos(@RequestBody SolicitudDonativos objSolicitudDonativos) {
		return serviceDonativosDeducibles.guardaSolicitudDonativos(objSolicitudDonativos);
	}
	
	
	@GetMapping("/consultaTipoSolicitud")
	public List<DTOTipoSolicitud> consultaTipoSolicitud(){
		return serviceDonativosDeducibles.consultaTipoSolicitud(); 
	}
	
	
	@PostMapping("/validaAutorizacion")
	public StringResponse validaAutorizacion(@RequestBody AutorizacionSolicitud solicitud) {
		return serviceDonativosDeducibles.validaAutorizacion(solicitud);
	}
	
	
	@GetMapping("/consultaActividades")
	public List<DTOActividades> consultaActividades(){
		return serviceDonativosDeducibles.consultaActividades(); 
	}
	
	@GetMapping("/descargaAcuse")
	public StringResponse descargaAcuse() {
		StringResponse response=new StringResponse(); 
		//response.setResponse("");
		return response; 
	}
	
	@GetMapping("/consultaEstados")
	public List<DTOEstados> consultaEstados(){
		return serviceDonativosDeducibles.consultaEstados();
	}
	
	@GetMapping("/consultaMunicipios")
	public List<DTOMunicipio> consultaMunicipios(@RequestParam String idEstado){
		
		return serviceDonativosDeducibles.consultaMunicipios(idEstado);
	}
	
	@GetMapping("/consultaCp")
	public List<DTOCodigoPostal> consultaCodigoPostal(@RequestParam("idMunicipio") String idMunicipio){
		return serviceDonativosDeducibles.consultaCodigoPostal(idMunicipio);
	}
	
}
